import React, { useEffect, useState } from "react";
import axios from "../api/axios";

const ReportsPage = () => {
  const [reports, setReports] = useState([]);

  useEffect(() => {
    axios.get("/reports/leaves").then(res => setReports(res.data));
  }, []);

  return (
    <div>
      <h2>Leave Reports</h2>
      <table>
        <thead>
          <tr><th>Employee</th><th>Type</th><th>From</th><th>To</th><th>Status</th></tr>
        </thead>
        <tbody>
          {reports.map(r => (
            <tr key={r.id}>
              <td>{r.employee.name}</td>
              <td>{r.leaveType.type}</td>
              <td>{r.startDate}</td>
              <td>{r.endDate}</td>
              <td>{r.status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ReportsPage;
